import styles from "./navbar.module.css"
import Link from 'next/link'
import {MenuItems} from "./menu_item.js"

export default function NabBar() {
    state = {clicked:false}; 

    return (
    <nav className= {styles.nav_bar_items} >

        <img className={styles.nav_bar_logo} src="/fg_logo.svg" alt="Logo"></img>

        <div className={styles.menu_icon} onClick={this.handleClick}>
            <img className={ this.state.clicked ? 
                "/menu_icons/x_menu.svg" : 
                "/menu_icons/hamb_menu.svg" 
            }></img>
        </div>

        <ul>
            {MenuItems.map((item, index) => 
                {return (
                    <Link href={item.url} key={index}>
                        <a className={ (item.onlyMobile)? styles.nav_link : styles.nav_link_movile }>
                            {item.title}
                        </a>
                    </Link>
                )}
            )}


        </ul>

    </nav>
    )
  }
